import React from 'react';
import './App.css';
import GameBoard from "./GameBoard";
import Divider from "./Divider";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p></p>
        <img src="game_board_copy.png" />
        <p></p>
      </header>
       <Divider />
    </div>
  );
}

export default App;
